import React from "react";

const Resume = () => {
    return (
        <>
            <div className="resume-conteiner">
                <div className="resume-header">
                    <h1>RESUME</h1>

                </div>
                <div className="resume-document">

                </div>
                <div className="resume-info">
                    <ul>
                        <li>Coffee</li>
                        <li>Tea</li>
                        <li>Milk</li>
                    </ul>
                </div>
            </div>
        </>
    );
};

export default Resume;
